DROP TABLE IF EXISTS `SYS_JURISDICTION`;
CREATE TABLE `SYS_JURISDICTION` (
  `ID` varchar(255) NOT NULL,
  `ROLE_ID` varchar(255) NOT NULL COMMENT '角色主键',
  `MENU_ID` varchar(255) NOT NULL COMMENT '菜单主键',
  `DEL` int NOT NULL COMMENT '删除标识',
  `EDIT` int NOT NULL COMMENT '修改标识',
  `DEL_STATE` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL COMMENT '删除标记',
  `CREATE_BY` varchar(32) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT '新增人',
  `UPDATE_BY` varchar(32) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT '修改人',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '新增时间',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '修改时间'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='角色权限关系表';

