-- ----------------------------
--  Table structure for `SYS_LOG`
-- ----------------------------
DROP TABLE IF EXISTS `SYS_LOG`;
CREATE TABLE `SYS_LOG` (
  `ID` varchar(64) NOT NULL,
  `MODULE` varchar(32) DEFAULT NULL COMMENT '模块名',
  `TITLE` varchar(128) DEFAULT NULL COMMENT '标题',
  `STATE` int DEFAULT NULL COMMENT '状态',
  `USER_ID` varchar(64) DEFAULT NULL COMMENT '操作用户',
  `SERVICE_NAME` varchar(64) DEFAULT NULL COMMENT '服务名',
  `DECLARED_METHOD_NAME` varchar(64) DEFAULT NULL COMMENT '方法名',
  `POJO` text COMMENT '参数json',
  `START_DATE` datetime DEFAULT NULL COMMENT '开始时间',
  `HANDLE_DATE` datetime DEFAULT NULL COMMENT '处理时间',
  `END_DATE` datetime DEFAULT NULL COMMENT '结束时间',
  `TIME_USE` float(64,3) DEFAULT NULL COMMENT '共用时',
  `ERROR_TEXT` varchar(255) DEFAULT NULL COMMENT '异常文本',
  `DEL_STATE` varchar(1) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL COMMENT '删除标记',
  `UPDATE_TIME` datetime NOT NULL COMMENT '修改时间',
  `UPDATE_BY` varchar(32) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT '修改人',
  `CREATE_TIME` datetime NOT NULL COMMENT '新增时间',
  `CREATE_BY` varchar(32) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT '新增人',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='日志表';

